import Typography from "@mui/material/Typography";
import React from "react";

function Program() {
  return (
    <div className="Program">
      <Typography variant="h4" style={{ textAlign: "center" }}>
        プログラム
      </Typography>
      <Typography>
        大会の概要およびプログラムを下記からダウンロードできます。
      </Typography>
    </div>
  );
}

export default Program;
